import React from 'react';
import { Container, Jumbotron } from 'reactstrap';
import "./Sponsors.css";


const Sponsors = (props) => {
  return (
    <div className="container">
    <br/>
    <Container className="tennisContainer">
      <br/>      
      <Jumbotron>
        Sponsor's Page
      </Jumbotron>
      <br/>
    </Container>

    </div>
  );
};

export default Sponsors;
